int add(int a, int b)
{
    a %= MOD;
    b %= MOD;
    return (a + b) % MOD;
}
int mul(int a, int b)
{
    a %= MOD;
    b %= MOD;
    return (a * b) % MOD;
}
void precmp()
{
    dp[1] = 1;
    dp[2] = 2;
    dp[3] = 5;
    for(int i = 4; i < N; i++)
    {
        dp[i] = mul(2, dp[i - 1]);
        dp[i] = add(dp[i], dp[i - 3]);
        // dp[i] = 2 * dp[i - 1] + dp[i - 3];
    }
}

